import React, { useState } from "react";
import Header from "./Header";
import Footer from "./Footer";
import Card from "./card"; // Assuming your Card component is defined in "./Card.js"
import contacts from "../contacts";
import Board from "./board";

const url = "https://api.quicksell.co/v1/internal/frontend-assignment?id=&title=Update User Profile Page UI&userId=usr-1&status=Todo&priority=";

function createCard(contact) {
  return (
    <Card
      key={contact.id}
      name={contact.name}
      img={contact.imgURL}
      heading={contact.heading}
    />
  );
}

function App() {
  return (
    <div>
      <Header />
      {contacts.map(createCard)}
      <Footer />
      <div className="app_outer">
        <div className="app_boards">
          <Board />
          <Board />
          <Board />
          <div className="board">
            <div className="board_top">
                <p className="board_top_title">To do <span>2</span></p>
                <Plus />
                <MoreHorizontal />
            </div>
            <div className="">
                <h1>Card 1</h1>
                <h1>Card 2</h1>
                {contacts.map(createCard)}
            </div>
        </div>
        </div>
      </div>
    </div>
  );
}



export default App;
